[[package]]
name = "alembic"
version = "1.6.5"
description = "A database migration tool for SQLAlchemy."
category = "main"
optional = false
python-versions = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,!=3.5.*,>=2.7"

[package.dependencies]
Mako = "*"
python-dateutil = "*"
